We first find $f(0)$:
\[\begin{array}{rcl}
f(0) &=& \left\{
\begin{array}{cl}
0^3+2\cdot 0-1 &\text{ if }0>1, \\
0-1 &\text{ if }0 \le 1.
\end{array}
\right. \\
&=& \left\{
\begin{array}{cl}
0 &\text{ if }0>1, \\
-1 &\text{ if }0 \le 1.
\end{array}
\right. \\
&=& -1.
\end{array}\]

We next find $f(1)$:
\[\begin{array}{rcl}
f(1) &=& \left\{
\begin{array}{cl}
1^3+2\cdot 1-1 &\text{ if }1>1, \\
1-1 &\text{ if }1 \le 1.
\end{array}
\right. \\
&=& \left\{
\begin{array}{cl}
1^3+2\cdot 1-1 &\text{ if }1>1, \\
0 &\text{ if }1 \le 1.
\end{array}
\right. \\
&=& 1^3+2\cdot 1-1.
\end{array}\]
Since \[1^3+2\cdot 1-1=\boxed{10},\]we have found $f(1)$.

We next find $f(2)$:
\[\begin{array}{rcl}
f(2) &=& \left\{
\begin{array}{cl}
2^3+2\cdot 2-1 &\text{ if }2>1, \\
2-1 &\text{ if }2 \le 1.
\end{array}
\right. \\
&=& \left\{
\begin{array}{cl}
8 &\text{ if }2>1, \\
3 &\text{ if }2 \le 1.
\end{array}
\right. \\
&=& \boxed{8}.
\end{array}\]

We now add $f(0)$, $f(1)$, and $f(2)$ to find the value of $f(0)+f(1)+f(2)$:
\[\begin{array}{rcl}
f(0)+f(1)+f(2) &=& (-1)+10+8. \\
&=& \boxed{-3}.
\end{array}\]

