\begin{align*}
    R(p,x) &= px \\
          &= (128-4p)x \\
          &\mbox{Maximize: } \qquad \qquad \qquad \qquad R(p,x) \qquad \qquad \qquad \qquad \qquad (p,x) \in [0,32] \times [0,128]
\end{align*}

The revenue-maximizing price is found by taking the partial derivatives of $R(p,x)$ with respect to $p$ and $x$, setting them equal to zero, and solving for $p$.
\begin{align*}
    \frac{\partial R(p,x)}{\partial p} &= x - 4p = 0 \\
    \frac{\partial R(p,x)}{\partial x} &= p = 0
\end{align*}
Solving these equations gives us $p=16$ and $x=64$. Therefore, the store should charge $p=16$ to maximize its revenue.

